import React from "react";
import {
  StyleSheet,
  Button,
  View,
  SafeAreaView,
  Text,
  Alert,
} from "react-native";

export default function App() {
  return (
    <View style={{ flex: 1 }}>
      <View style={{ position: "absolute",
                      left:0,
                      right:0,
                      top:0,
                      height:70,
                      backgroundColor:"gray"
    }}></View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
